import React from 'react';
import { HashLink as Link } from 'react-router-hash-link';
import {Router} from 'react-router-dom';
import {
    NavBarContainer,
    NavigationContainer,
    NavigationButton
} from './navBar.styled'

const NavBar = () => {
    return (
        <NavBarContainer>
            <NavigationContainer>
                <Router>
                <Link to=":about"><NavigationButton>About</NavigationButton></Link>
                <NavigationButton></NavigationButton>
                </Router>
            </NavigationContainer>
        </NavBarContainer>
    )
}

export default NavBar;
